class SuggestionTextModel {
  SuggestionTextModel({
    bool? success,
    List<String>? data,
  }) {
    _success = success;
    _data = data;
  }

  SuggestionTextModel.fromJson(dynamic json) {
    _success = json['success'];
    _data = json['data'] != null ? json['data'].cast<String>() : [];
  }
  bool? _success;
  List<String>? _data;
  SuggestionTextModel copyWith({
    bool? success,
    List<String>? data,
  }) =>
      SuggestionTextModel(
        success: success ?? _success,
        data: data ?? _data,
      );
  bool? get success => _success;
  List<String>? get data => _data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['success'] = _success;
    map['data'] = _data;
    return map;
  }
}
